import React from "react";

const Button = ({ children, size, variant='outlined', ...rest }) => {
  if(variant=== 'oulined'){
    return '#442424'
  }
  return (
    <button size={size} variant={getVariant} {...rest}>
      {children}
    </button>
  );
};

export default Button;

const getVariant = (props) => {
    return variant === props.variant
};
